import eikon as ekimport osimport pandas as pdimport loggingfrom commodplot import jinjautils as jufrom oilanalytics.utils import chartutils as cueikonkey = os.environ['EIKON_KEY']ek.set_app_key(eikonkey)start_date = '2010-01-01'def singapore_data(start_date=start_date, df:pd.DataFrame=None) -> pd.DataFrame:    rics = {        'LightDistillates' : 'STKLD-SIN',        'MiddleDistillates' : 'STKMD-SIN',        'HeavyDistillates' : 'STKRS-SIN',    }    if df is None:        df = ek.get_timeseries(list(rics.values()), fields='Close', start_date=start_date)        df = df.rename(columns=dict((v, k) for k, v in rics.items()))    df = df / 1000  # kbbl to mbbl    df.attrs['region'] = 'singapore'    return dfdef generate_singapore_page(df_data=None, out_loc:str=None):    logging.info('generating singapore page')    if df_data is None:        df_data = singapore_data()    data = {'name': 'Singapore', 'title': 'Singapore', 'df_input': df_data}    ju.render_html(data, 'singapore.html', out_loc, package_loader_name='oilfundamentals.highfrequency',                   template_globals={'cu': cu})